 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">1. Ruang Laboratorium Enchange Oil Recovery.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Tempat di mana penelitian dan eksperimen dilakukan untuk mengembangkan dan menguji metode-metode yang dapat meningkatkan perolehan minyak dari reservoir yang sudah tidak bisa diolah dengan metode konvensional.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">2. Ruang Pranata.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang lingkup tugas, tanggung jawab, dan wewenang yang dimiliki oleh jabatan fungsional tertentu, dalam konteks pemerintahan dan kepegawaian.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">3. Ruang Preparasi Oil Enchange Recovery.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruangan yang berfungsi sebagai tempat persiapan alat dan bahan yang akan digunakan dalam suatu kegiatan, terutama dalam laboratorium.</SPAN></DIV></div>",
