 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang Panel.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruangan yang digunakan untuk menampilkan atau mempresentasikan data atau informasi dalam bentuk panel atau layar, misalnya dalam acara seminar, presentasi, atau kegiatan kampus lainnya.</SPAN></DIV></div>",
