 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang Administrasi dan PLP.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang yang berfungsi sebagai pusat administrasi dan pelaksanaan program Pengenalan Lapangan Persekolahan (PLP). Ruang ini biasanya menjadi tempat yang digunakan untuk mengkoordinasikan kegiatan PLP, seperti memberikan informasi, menjadwalkan kegiatan, dan melakukan monitoring terhadap peserta PLP.</SPAN></DIV></div>",
