 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang Laboratorium Mikroskopik Optik.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Tempat yang dirancang khusus untuk melakukan pengamatan mikroskopis, yaitu pengamatan objek-objek yang sangat kecil yang tidak terlihat dengan mata telanjang. Ruang ini dilengkapi dengan berbagai mikroskop optik, alat-alat pendukung untuk persiapan sampel, dan perangkat lunak untuk analisis gambar. </SPAN></DIV></div>",
