 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">1. Ruang Laboratorium Gas.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruangan di dalam laboratorium yang dirancang khusus untuk menyimpan, menggunakan, dan menguji gas. Ruangan ini dilengkapi dengan sistem perpipaan, sensor, dan peralatan lain yang diperlukan untuk keamanan dan efektivitas penggunaan gas. </SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">2. Ruang Pranata.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang lingkup tugas, tanggung jawab, dan wewenang yang dimiliki oleh jabatan fungsional tertentu, dalam konteks pemerintahan dan kepegawaian.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">3. Ruang Preparasi.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruangan yang berfungsi sebagai tempat persiapan alat dan bahan yang akan digunakan dalam suatu kegiatan, terutama dalam laboratorium.</SPAN></DIV></div>",
