 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang Preparasi Sayatan Tipis dan Poles.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Area di laboratorium yang digunakan untuk mempersiapkan sampel batuan atau mineral agar dapat diamati di bawah mikroskop, khususnya mikroskop polarisasi. Proses ini melibatkan pemotongan batuan atau mineral menjadi irisan tipis (sekitar 0,03 mm) atau irisan yang dipoles untuk mempermudah pengamatan sifat optik dan struktur mineral.</SPAN></DIV></div>",
