 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">1. Ruang Pantry.</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Area atau lemari yang digunakan untuk menyimpan bahan makanan, minuman, dan peralatan masak di dalam rumah atau kantor. Pantry biasanya berada di dekat dapur dan berfungsi sebagai tempat penyimpanan yang terorganisir. </SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">2. Mushola</SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ruang atau tempat ibadah bagi umat Islam, khususnya untuk salat, yang biasanya lebih kecil daripada masjid dan sering ditemukan di tempat-tempat umum.</SPAN></DIV></div>",
